def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""

    parts = input1.split()
    result = []

    for part in parts:
        sub_parts = part.split('-')
        transformed_sub_parts = [sub.capitalize() for sub in sub_parts]
        result.append(''.join(transformed_sub_parts))

    return ' '.join(result)
